import React from 'react';

//6 applications with github link and working page link
function Portfolio() {
  return (
    <div>
      <h1>Portfolio</h1>

      <div class="box-item box-2"
        onclick="location.href='https://sboucher2011.github.io/robot-gladiators/'" target="_blank"
        style="cursor: pointer;">
        <div class="title-block">
          <h4>Robot Gladiators</h4>
          <p>JAVASCRIPT</p>
        </div>
      </div>
    </div>
  );
}

export default Portfolio;
